import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import  styled  from "styled-components";


const MainDiv = styled.div`

`;

const MainCard = styled(Card)`
margin-bottom:30px;
margin-left:220px;
// margin-right:400px;
margin-top:30px;
float:left;
width:500px;
`;

const CardContentDiv = styled(CardContent)`
    background-color:#f1f1f1;
`;

const CardContentDiv1 = styled(CardContent)`
    background-color:#808080;
`;

const TypographyDiv = styled(Typography)`

`;

const MainCard2 = styled(Card)`
margin-bottom:30px;
// margin-left:400px;
margin-right:220px;
margin-top:30px;
width:500px;
float:right;
`

const TextDiv = styled.h2`

`


function ContactPage(props) {

    return (
        <MainDiv>
        <MainCard >
            <CardContentDiv>
                <TypographyDiv>
                    <TextDiv>Address</TextDiv>
                 </TypographyDiv>
                <TypographyDiv>
                    ssss
                </TypographyDiv>
                <TypographyDiv>
                    adjective
                </TypographyDiv>
                <TypographyDiv>
                    well meaning and kindly.
                     <br />
                    {'"a benevolent smile"'}
                </TypographyDiv>
            </CardContentDiv>
        </MainCard>

        <MainCard2 >
            <CardContentDiv1>
                <TypographyDiv>
                   <TextDiv>Send Me a Message</TextDiv> 
                 </TypographyDiv>
                <TypographyDiv>
                   ssss
                </TypographyDiv>
                <TypographyDiv>
                    adjective
                </TypographyDiv>
                <TypographyDiv>
                    well meaning and kindly.
                     <br />
                    {'"a benevolent smile"'}
                </TypographyDiv>
            </CardContentDiv1>
        </MainCard2>
        </MainDiv>
    );
}

export default ContactPage;
